import React from "react";
import ReactDOM from "react-dom/client";
import "./index.css";

const root = ReactDOM.createRoot(document.getElementById("root"));
const user = { name: "Bob" };

function MyButton() {
  return <button>Click me</button>;
}

export default function App() {
  return (
    <>
      <h1>Hello</h1>
      <div>
        <MyButton />
        <img className="avatar" />
        <h1>{user.name}</h1>
      </div>
    </>
  );
}

root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
);
